.ui-button {
  font-family: 'DM Sans', sans-serif;
  font-weight: 700;
  border: 0;
  border-radius: 4px;
  cursor: pointer;
  display: inline-block;
  box-sizing: border-box;
  transition: ease-in-out .3s;

  &:not(.ui-button--disabled):not(.ui-button--outline) {
    box-shadow: 0 2px 8px #0D4B7C44;
  }
}

.ui-button--primary {
