  background-color: #2DA1FD;
  border: 2px solid #2DA1FD;
}

.ui-button--secondary {
  color: white;
  background-color: #334587;
  border: 2px solid #334587;
}

.ui-button--small {
  font-size: 12px;
  padding: 5px 10px;
  text-transform: uppercase;
}

.ui-button--medium {
  font-size: 14px;
